<template>
  <div>
    <h3>通过组件方式</h3>
    <div class="imgs">
      <div v-for="(url, i) in urls" class="img" :key="`c_${i}`" @click="() => showImagesByComponent(i)">
        <img :src="url" />
      </div>
    </div>
    <ImgViewr :visible="visible" :urls="urls" :initialIndex="index" @close="close" @switch="change" />
    <h3>通过js方法调用</h3>
    <div class="imgs">
      <div v-for="(url, i) in urls" class="img" :key="i" @click="() => showImagesByJs(i)">
        <img :src="url" />
      </div>
    </div>
  </div>
</template>
<script lang="ts">
import { ref, getCurrentInstance } from 'vue'
import ImgViewr, { showImages } from './img-viewr/index'
import '../styles/index.css'

export default {
  name: 'App',
  components: { ImgViewr },
  setup () {
    const images = [
      'data:image/png;base64,',
      'data:image/png;base64,'
    ]
    const urls = ref(images)
    const index = ref(0)
    const visible = ref(false)
    const showImagesByComponent = i => {
      visible.value = true
      index.value = i
    }
    const { appContext } = getCurrentInstance()
    const showImagesByJs: (index: number) => void = index => {
      if (appContext !== null) {
        /* appContext.config.globalProperties.$showImages({
          urls: images,
          index,
          onSwitch: change,
          onClose: close
        }) */
        showImages({
          urls: images,
          index,
          onSwitch: change,
          onClose: close
        })
      }
    }
    const change = () => {}
    const close = () => {
      visible.value = false
    }
    return {
      urls,
      index,
      visible,
      showImagesByComponent,
      showImagesByJs,
      close,
      change
    }
  }
}
</script>
<style scoped>
.imgs {
  display: flex;
}
.img {
  width: 150px;
  height: 100px;
  border: 1px solid #EEE;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 20px;
}
.img img {
  max-width: 100%;
  max-height: 100%;
  cursor: pointer;
}
</style>
